class Item{
  final int id;
  final String name;
  final String decs;
  final num price;
  final String imageUrl;



  Item({required this.id, required this.name, required this.price, required this.imageUrl,required this.decs});

  factory Item.fromMap(Map<String,dynamic>Map){

    var map;
    return Item(
        id:map["id"],
        decs: map["decs"],
        name:map["name"],
        price:map["price"],
        imageUrl:map["image"]
    );
  }
  toMap()=>{
    "id":id,
    "name":name,
    "price":price,
    "decs":decs,
    "imageUrl":imageUrl
  };
}